// Footer.js
import React from 'react';

const footerStyle = {
  display: 'flex',
  justifyContent: 'space-around',
  padding: '20px',
  background: '#f5f5f5',
  color: '#333'
};

const columnStyle = {
  display: 'flex',
  flexDirection: 'column'
};

const titleStyle = {
  fontSize: '1.25rem',
  marginBottom: '0.5rem'
};

const listStyle = {
  listStyle: 'none',
  padding: 0
};

const listItemStyle = {
  marginBottom: '0.25rem',
  cursor: 'pointer'
};

const Footer = () => {
  return (
    <footer style={footerStyle}>
      <div style={columnStyle}>
        <h3 style={titleStyle}>MyTravaly</h3>
        <ul style={listStyle}>
          <li style={listItemStyle}>Company Details</li>
          <li style={listItemStyle}>Career</li>
          <li style={listItemStyle}>Terms & Conditions</li>
          <li style={listItemStyle}>Privacy Policy</li>
          <li style={listItemStyle}>Contact us</li>
        </ul>
      </div>
      <div style={columnStyle}>
        <h3 style={titleStyle}>Reservations Centre</h3>
        <ul style={listStyle}>
          <li style={listItemStyle}>Helpdesk</li>
          <li style={listItemStyle}>Make a Reservation</li>
          <li style={listItemStyle}>Guest Bookings Policy</li>
          <li style={listItemStyle}>Get the App</li>
          <li style={listItemStyle}>Trust and Safety</li>
        </ul>
      </div>
      <div style={columnStyle}>
        <h3 style={titleStyle}>Hotel Business Centre</h3>
        <ul style={listStyle}>
          <li style={listItemStyle}>Add Hotel</li>
          <li style={listItemStyle}>Resources</li>
          <li style={listItemStyle}>Connectivity Centre</li>
          <li style={listItemStyle}>Business Policy</li>
          <li style={listItemStyle}>Cyber Security & Awareness</li>
        </ul>
      </div>
    </footer>
  );
};

export default Footer;
